const { request, response } = require("express");
const express = require("express");

const app = express();

const PORT = 8082;

app.get("/", (request, response) => {
  response.status(200).send("<h1>Day-79 Babel</h1>");
});

app.listen(PORT, () => {
  console.log(`Application is running on http://localhost:${PORT}`);
});

